import React from 'react';
import { Link } from 'react-scroll';


function Navigation() {
    return <nav>
        <ul>
            <li>
                <Link
                    to="O mne"
                    spy={true}
                    smooth={true}
                    offset={50}
                    duration={500}
                >O mne</Link>
            </li>
            <li>
                <Link
                    to="Moje projekty"
                    spy={true}
                    smooth={true}
                    offset={-50}
                    duration={500}
                >Moje projekty</Link>
            </li>
            <li>
                <Link
                    to="Moje schopnosti"
                    spy={true}
                    smooth={true}
                    offset={50}
                    duration={500}
                >Moje schopnosti</Link>
            </li>
            <li>
                <Link
                    to="O mne"
                    spy={true}
                    smooth={true}
                    offset={50}
                    duration={500}
                >Kontakt</Link>
            </li>
        </ul>
    </nav>
}



export default Navigation;
